class NotifyDataType(Enum):
    AFE = 0xA0
    IMU = 0xA1
    TEMP = 0xA2
    @staticmethod
    def get(value: int):
        # Iterate over the enum members and return the one matching the value
        for cmd in NotifyDataType:
            if cmd.value == value:
                return cmd

class AccDataHandler:
    @staticmethod
    def parse(data: bytearray, length: int) -> AccData:
        num_samples = int(length / 2)
        imu_data = struct.unpack(f"<{num_samples}h", data)
        for i in range(0, num_samples, 3):
            raw_x = imu_data[i]
            raw_y = imu_data[i + 1]
            raw_z = imu_data[i + 2]
        return AccData(raw_x, raw_y, raw_z)

